export const HubspotIntegration = {
    name: "HubSpot",
    slug: "hubspot",
    description: "Connect to HubSpot to manage contacts and deals.",
    authorizeUrl: "/integrations/hubspot/authorize",
    icon: "https://cdn.iconscout.com/icon/free/png-256/hubspot-3521467-2944922.png",
  };
  
  export const getHubspotItems = async () => {
    const response = await fetch('/integrations/hubspot/items');
    if (!response.ok) {
      throw new Error('Error fetching HubSpot items');
    }
    return response.json();
  };
